import {CREATE_ROOM} from "../actions";

const initialState = {
    title: 'もちまっちげーみんぐ',
    test: 'test',
    room: 0
}

const testReducer = (state = initialState, action) => {
    switch (action.type) {
        case CREATE_ROOM:
            const nextState = state.room++;
            state: nextState
            console.log(state);
            return state;

        default:
            return state;
    }
}

export default testReducer;
